/*Table structure for table `auth_menu` */

DROP TABLE IF EXISTS `auth_menu`;

CREATE TABLE `auth_menu` (
  `id` varchar(16) NOT NULL DEFAULT '' COMMENT 'ID',
  `name` varchar(40) NOT NULL DEFAULT '' COMMENT '名称',
  `code` varchar(100) NOT NULL DEFAULT '' COMMENT '菜单唯一标识',
  `url` varchar(4000) NOT NULL DEFAULT '' COMMENT 'URL',
  `type` int(1) NOT NULL DEFAULT '0' COMMENT '权限类型表(0无动作,1有动作)',
  `parent_id` varchar(16) DEFAULT NULL COMMENT '上级ID(如果为0，则为顶级)',
  `description` varchar(100) NOT NULL DEFAULT '' COMMENT '描述',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `system_mark` varchar(255) NOT NULL DEFAULT '' COMMENT '系统标识',
  `creator` varchar(32) NOT NULL DEFAULT '' COMMENT '创建人',
  `is_enable` int(1) NOT NULL DEFAULT '0' COMMENT '是否删除0否1删除',
  `menu_sort` int(3) NOT NULL DEFAULT '0' COMMENT '菜单排序',
  `menu_flag` varchar(32) NOT NULL DEFAULT '' COMMENT '菜单标识',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='菜单表';

