/*Table structure for table `auth_operator_log` */

DROP TABLE IF EXISTS `auth_operator_log`;

CREATE TABLE `auth_operator_log` (
  `id` varchar(16) NOT NULL DEFAULT '' COMMENT '主键',
  `operator_module` varchar(200) NOT NULL DEFAULT '' COMMENT '所属功能模块',
  `operator_data` varchar(2000) NOT NULL DEFAULT '' COMMENT '传输数据',
  `create_time` datetime NOT NULL COMMENT '操作时间',
  `creator` varchar(32) NOT NULL DEFAULT '' COMMENT '操作人',
  `operator_type` int(1) NOT NULL COMMENT '操作类型（0：新增；1：修改；2：删除）',
  `operator_method` varchar(200) NOT NULL DEFAULT '' COMMENT '操作方法',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='操作日志表';

