/*Table structure for table `auth_power` */

DROP TABLE IF EXISTS `auth_power`;

CREATE TABLE `auth_power` (
  `id` varchar(16) NOT NULL DEFAULT '' COMMENT '主键ID',
  `code` varchar(100) NOT NULL DEFAULT '' COMMENT '编码',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '中文名字',
  `menu_id` varchar(32) NOT NULL DEFAULT '' COMMENT '菜单ID',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `creator` varchar(32) NOT NULL DEFAULT '' COMMENT '创建人',
  `is_enable` int(1) NOT NULL DEFAULT '0' COMMENT '是否删除0否1删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='按钮';

