/*Table structure for table `auth_user` */

DROP TABLE IF EXISTS `auth_user`;

CREATE TABLE `auth_user` (
  `id` varchar(16) NOT NULL DEFAULT '' COMMENT 'ID',
  `username` varchar(40) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` varchar(255) NOT NULL DEFAULT '' COMMENT '密码',
  `real_name` varchar(40) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '状态(1:正常0禁用)',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `email` varchar(255) NOT NULL DEFAULT '',
  `is_locked` int(1) NOT NULL DEFAULT '0' COMMENT '是否锁定0：未锁定；1：锁定',
  `locked_date` datetime DEFAULT NULL COMMENT '锁定时间',
  `login_date` datetime DEFAULT NULL COMMENT '登陆时间',
  `login_failure_count` int(11) NOT NULL DEFAULT '0' COMMENT '登陆失败次数',
  `login_ip` varchar(255) NOT NULL DEFAULT '' COMMENT '登陆IP',
  `creator` varchar(32) NOT NULL DEFAULT '' COMMENT '创建人',
  `is_enable` int(1) NOT NULL DEFAULT '0' COMMENT '是否删除0否1删除',
  `is_update_pwd` int(1) NOT NULL DEFAULT '0' COMMENT '是否修改密码：0：否；1：修改',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表';

